import React from "react";
import '../style.css';

// function home() {
//   return (
//     <>  
//     <p>hey</p>
//     </>
      
//   );
// }

// export default home();

function home() {
  return (
    <>
      <div className="bg-[#E6EDFF] flex flex-col p-[37px_100px_100px_76px] w-[1440px] box-sizing-border">
        <img className="absolute top-[154px] right-[-190px] w-[662px] h-[581px]" alt="imp1"/>
        <div className="relative m-[0_0_52px_0] flex flex-row justify-between w-[1264px] box-sizing-border">
          <div className="rounded-[50px] flex flex-row justify-between w-[475px] box-sizing-border">
            <div className="flex flex-row box-sizing-border">
              <div className="rounded-[50px] bg-[#FFFFFF] relative m-[0_23px_0_0] flex p-[6px_0_6px_0.6px] w-[111px] box-sizing-border">
                <span className="break-words font-['Open_Sans'] font-semibold text-[22px] text-[#101010]">
                  Home
                </span>
              </div>
              <div className="m-[6px_0_6px_0] inline-block break-words font-['Open_Sans'] font-semibold text-[22px] text-[#000000]">
                Services
              </div>
            </div>
            <div className="m-[6px_0_6px_0] inline-block break-words font-['Open_Sans'] font-semibold text-[22px] text-[#000000]">
              Location
            </div>
            <div className="m-[6px_0_6px_0] inline-block break-words font-['Open_Sans'] font-semibold text-[22px] text-[#000000]">
              Profile
            </div>
          </div>
          <div className="rounded-[10px] m-[6px_0_1px_0] flex flex-row w-[280px] h-[fit-content] box-sizing-border">
            <div className="rounded-[10px] bg-[#101010] relative m-[0_16px_0_0] flex p-[5.5px_0_7.5px_3.2px] w-[132px] box-sizing-border">
              <span className="break-words font-['Open_Sans'] font-bold text-[16px] text-[#FFFFFF]">
                Sign In
              </span>
            </div>
            <div className="rounded-[10px] border-[2px_solid_#000000] relative flex p-[5.5px_0.4px_7.5px_0] w-[132px] box-sizing-border">
              <span className="break-words font-['Open_Sans'] font-bold text-[16px] text-[#000000]">
                Sign Up
              </span>
            </div>
          </div>
        </div>
        <div className="bg-[url('assets/images/Image.jpeg')] bg-[50%_50%] bg-cover bg-no-repeat relative m-[0_439px_52px_0] self-center w-[663px] h-[448px]">
        </div>
        <div className="relative m-[0_24px_0_24px] flex flex-col self-start w-[fit-content] box-sizing-border">
          <img className="m-[0_0_20px_0] w-[973px] h-[79px]" alt="img2"/>
          <p className="m-[0_0_20px_0] self-start break-words font-['Open_Sans'] italic font-semibold text-[40px] text-[#101010]">
            <span className="roadside-rescuers-when-you-need-help-were-on-the-way-sub-0"></span><span></span>
          </p>
          <span className="self-start break-words font-['Open_Sans'] italic font-normal text-[24px] text-[#101010]">
            We are a well-equipped towing service available to help with towing your vehicle 24/7 we provide a fast,affordable,friendly,and reliable car towing service.
          </span>
        </div>
      </div>
    </>
  )
}
export default home();
